column8:
付属のペンでサッと書けてボタンを押すだけで画面を消去できる！<br>
<br>
8.5インチの大きな画面にスケジュールなどのメモやお絵かきなど用途は色々！<br>
付属のペンで簡単にメモを書くこと出来ます。<br>
<br>
画面を消したい時は上部にあるボタンを押せば書いたメモが全て消えます。<br>
<br>
軽量110gでコンパクト！カバンに入れて持ち運びが可能です。<br>
重さは僅か約110gの軽量で持ち運びに便利！本体も薄くて邪魔になりません。<br>
<br>
低電力で約2年使用できる！電池切れの際も電池交換できます！<br>
<br>
コイン型のリチウム電池(CR2016)を使用しており、電池が切れた際も交換が可能です。<br>
使用状況により異なりますが、約2年(約3万回)の消去が出来ます。<br>
<br>
電池交換も簡単で上部の電池収納部から古い電池を取り出して新しい電池を<br>
入れるだけです。<br>
<br>
サイズ(約)：221×146×4.5mm (8.5インチ)<br>
材質：ABS<br>
重量(約)：110g<br>
消去回数：約3万回<br>
電池：コイン型リチウム電池 CR2016<br>
カラー：ブラック、ホワイト、レッド、イエロー<br>
製造国：中国<br>
<br>
※付属の電池はテスト電池になります。<br>
※付属のペンは入荷時期により若干デザインが異なる場合が御座います。<br>
　(ペン先のカラー等)<br>
<br>
※こちらの商品はメール便発送にて送料無料です。<br>
※ゆうメールでの発送は（ポスト投函）代金引換、日付指定はできませんのでご了承ください。<br>
